$(document).ready(function () {
    buildProductView(data)
});
$(".all").on("click", function () {
    buildProductView(data)
    
});

// sorting by brand
$(".tugma").on("click", function () {
    let filterBrand = this.innerHTML;
    let filterData = data.filter((comp) => (filterBrand === comp.brand) ? true : false);
    buildProductView(filterData)
    
})


// sorting by price
$(".sorted-price li a.divided").on("click", function () {
    let sortedArr = data.sort((a, b) => {
        return a.price - b.price;
    });
    buildProductView(sortedArr)
});

$(".sorted-price li a.reversed").on("click", function () {
    let sortedArr = data.sort((a, b) => {
        return b.price - a.price;
    });
    buildProductView(sortedArr)
});

// sorting by price
$(".sorted-price li a.alphabet").on("click", function () {

    data.sort(function (a, b) {
        return a.name.localeCompare(b.name);
    });
    if (this.innerHTML === "Brand A - Z") {
        buildProductView(data);
    } else {
        data.reverse();
        buildProductView(data)
    }
});

// qidiruv boyicha saralash
$("#search").on("keyup", function(){
    let currentText = $(this).val().toLowerCase();
    let filtered = data.filter((obj) => {
        let newObj = JSON.stringify(obj).toLowerCase();
        if(newObj.includes(currentText)){
            return true;
        }else{
            return false
        }
    });
    buildProductView(filtered)
});







function buildProductView(arr) {
    $("#place").empty();
    arr.forEach((comp) => {

        let perProduct =
            '<div class="card" style="width: 18rem;">' +
            ' <img src=" ' + comp.imgUrl + ' ">' +
            '<div class="card-body">' +
            '  <h5 class="card-title">' + comp.name + '</h5>' +
            '<p class="card-text">' + comp.brand + '</p>' +
            '<a href="#" class="btn btn-primary">' + ' ' + comp.price + '</a>' +
            '</div>' +
            ' </div>';
        $("#place").append(perProduct);
    });

}


